export default function TodoList(){
    const [todos, useTodos] = useState('')
    useEffect(() => {
        fetch('/api/todo_list?format=json')
        .then(response => response.json())
        .then(data => useTodos(data))
    })
    return(
        <>
        <div className="registrationDiv">
            <p>Todo List</p>
            <p>{todos}</p>
        </div>          
        </>
    )
}
